import { extendObservable } from 'mobx';

class UserStore {
    constructor() {
        extendObservable(this, {
            // loading: true,
            // isLoggedIn: false,
            username: '',
            // loading: false,
            isLoggedIn: true,
            // username: ''
        })
    }
}

export default new UserStore;
